import React from 'react';
import SearchIcon from '@mui/icons-material/Search';
import { TwitterTimelineEmbed } from 'react-twitter-embed';
import './Widgets.css';

const Widgets = () => {
    return (
        <div className='widgets'>
            <div className='widgets_input'>
                <SearchIcon className='widgets_searchIcon' />
                <input type='text' placeholder='SearchTwitter' />
            </div>
            <div className='widgets_widget_Container'>
                <h2>What's happening</h2>
            </div>
            
                <blockquote class="twitter-tweet"><p lang="en" dir="ltr">Went to the Eagle Pass border crossing to see whatâ€™s really going on <a href="https://t.co/ADYY2XvAKT">pic.twitter.com/ADYY2XvAKT</a></p>&mdash; Elon Musk (@elonmusk) <a href="https://twitter.com/elonmusk/status/1707565081750290910?ref_src=twsrc%5Etfw">September 29, 2023</a></blockquote> <script async src="https://platform.twitter.com/widgets.js" charset="utf-8"></script>
            
            <TwitterTimelineEmbed
                sourceType='profile'
                screenName='TwitterDev'
                options={{ height: 400 }}
            />
        </div>
    );
}

export default Widgets;
